import React, { useState, useEffect } from 'react';
import "../styles/Home.css";
import crackd1 from "../assets/alruwais-mockup.png";
import crackd2 from "../assets/crackdmultihumor.png";
import crackd3 from "../assets/crackdLogoBlack.png";

const phrases = [
  'user interfaces',
  'user experiences',
  'website design',
];

function Typewriter({ words, speed = 150, pause = 2000 }) {
  const [displayedText, setDisplayedText] = useState('');
  const [wordIndex, setWordIndex] = useState(0);
  const [charIndex, setCharIndex] = useState(0);
  const [deleting, setDeleting] = useState(false);

  useEffect(() => {
    let timeout;
    const currentWord = words[wordIndex];

    if (!deleting) {
      if (charIndex < currentWord.length) {
        // Typing forward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex + 1));
          setCharIndex(charIndex + 1);
        }, speed);
      } else {
        // Word fully typed, pause before deleting
        timeout = setTimeout(() => {
          setDeleting(true);
        }, pause);
      }
    } else {
      if (charIndex > 0) {
        // Deleting backward
        timeout = setTimeout(() => {
          setDisplayedText(currentWord.substring(0, charIndex - 1));
          setCharIndex(charIndex - 1);
        }, speed / 2);
      } else {
        // Finished deleting, move to next word
        timeout = setTimeout(() => {
          setDeleting(false);
          setWordIndex((wordIndex + 1) % words.length);
        }, 500);
      }
    }

    return () => clearTimeout(timeout);
  }, [charIndex, deleting, wordIndex, words, speed, pause]);

  return <span>{displayedText}</span>;
}

function Tagline() {
  return (
    <div>
      <h1 className="tagline">
        an interdisciplinary designer
        <br />
        focused on creating
        <br />
        <span className="typewriter-container">
        meaningful <Typewriter words={phrases} />
        </span>
      </h1>
    </div>
  );
}

function HumorProjectTextSection({ style }) {
  return (
    <div style={style}>
      <h1 className="projectName">The Humor Project</h1>
      <h2 className="projectDescriptionHeader">second mini header describing the project</h2>
      <p className="projectDescription">
        description description description description
      </p>
    </div>
  );
}

function HumorProjectImagesSection({ style }) {
  return (
    <div style={style}>
      <h2>User-Interfaces & Web Design</h2>
      <div style={{ position: "relative", width: "100%", height: "300px" }}>
        <img src={crackd1} alt="First UI" style={{ position: "absolute", top: 0, left: 0, width: "250px", zIndex: 1 }} />
        <img src={crackd2} alt="Second UI" style={{ position: "absolute", top: "50px", left: "150px", width: "250px", zIndex: 2 }} />
        <img src={crackd3} alt="Third UI" style={{ position: "absolute", top: "100px", left: "300px", width: "250px", zIndex: 3 }} />
      </div>
    </div>
  );
}



export default function Home() {
  return (
    <div style={{ display: "flex", justifyContent: "space-between", alignItems: "flex-start", padding: "2rem" }}>
      {/* Left column: text */}
      <HumorProjectTextSection style={{ flex: 1, maxWidth: "50%", marginRight: "2rem" }} />

      {/* Right column: images */}
      <HumorProjectImagesSection style={{ flex: 1, maxWidth: "50%" }} />
    </div>
  );
}
